- input: TEXT,F3XA,,"Amendent 2 has been made to correct the allocation formula percentages
    used originally. Our allocation formula should be based on a senate candidate
    only election year. We have transferred funds from our federal account to repay
    our non-federal account for this difference on 3/09/06.  This amendment is made
    to include an allocation transfer of administrative expenses dated 12/30/05.  This
    allocation was made within 60 days of payment to the vendor. We used the fixed
    percentage allocation ratio for 2005.   In response to the Federal Election Commissions's
    prelimary review of the December monthly report,  Calendar year-to-date total
    from the previous report and Total This Period are corrected to match.  Also the
    beginning cash balance of this report equals the ending balance of the November
    Monthly Report."
